  [],\n\t\"title\": \"Streamflow gain/loss in the Republican River Basin, Nebraska,
  October 1978\",\n\t\"tracking_summary\": {\n\t\t\"total\": 2,\n\t\t\"recent\": 1\n\t},\n\t\"groups\":
